import React from 'react';

const EventInfo = props => {
    const rows = props.bookData.map((row, index) => {
      return (
        <div className='event'>
          <h1>{props.resultsPage.results.event[0].displayName}</h1>
        </div>
      );
    });
    return <div>{rows}</div>;
  };

class Book extends React.Component {
    render() {

      const { eventData } = this.props;
      return <EventInfo eventData={eventData} />;
    }
  }

  export default Book;
